import styled from "styled-components/native";
import { View } from "react-native";

const positionVariant = {
  top: "marginTop",
  left: "marginLeft",
  right: "marginRight",
  bottom: "marginBottom",
};

const size = {
  small: 1,
  medium: 2,
  large: 3
};

export const Spacer = styled(View)`
  ${(props) =>`${positionVariant[props.position]}:${props.theme.sizes}`}
`;
